import React from 'react';
import './style.css'

const Message = (props) => {
  const {
    type,
    text,
    time
  } = props

  return (
    <div className='chat-box'>
      <span className={ type === 'Incoming' ? 'msg-text-left' : 'msg-text-right' }>
          {text}
          <p>{time}</p>
      </span>
    </div>
  );
};

export default Message;
